import React from 'react';
import Search from './search';
import Box from './box';

class MyApp extends React.Component{
    render(){
        return(
            <div>

                <Search />
                <Box head="Save more on your next hotel" sub="Thousands of deals made every day"/>
            </div>
        );
    }
}

export default MyApp;
